import Card from '../Card/Card.js';

const Cards = (props)=>{
    
    return (
        <div className="containerCards">
                     {props.allVideoGamer.map((c)=>(
                          <Card key={c.id} character={c} />
           ))
        }          

              {
                props.forEach(element => {
                    <Card key={element.id} datos={element} />
                  }
              )
            }

        </div>
    )
}

export default Cards;
